import React from "react";
import Box from "@mui/material/Box";

import SideBar from "../Sidebar/SideBar";
import CustomerCount from "../CustomerInfo/CustomerCount";
//Box 1=Total customers  Box2-Pending orders Box3=Confirmed orders Box4=Total sales
const Dashboard = () => {
  const customerNo = 22;
  const saleNo = 22;
  const confirmedNo = 22;
  const pendingNo = 22;
  return (
    <>
      <SideBar />
      <div className="boxes">
        <Box
          height={200}
          width={200}
          color="black"
          backgroundColor="white"
          fontSize={30}
          my={4}
          gap={4}
          p={2}
          sx={{ border: "2px solid grey" }}
        >
          Total Customers
          <br />
          <br />
          {CustomerCount()}
        </Box>
        <Box
          height={200}
          width={200}
          color="black"
          backgroundColor="white"
          my={4}
          fontSize={30}
          gap={4}
          p={2}
          sx={{ border: "2px solid grey" }}
        >
          Total sales
          <br />
          <br />
          <br />
          {saleNo}
        </Box>
        <Box
          height={200}
          width={200}
          color="black"
          backgroundColor="white"
          my={4}
          fontSize={30}
          gap={4}
          p={2}
          sx={{ border: "2px solid grey" }}
        >
          Pending orders
          <br />
          <br />
          {pendingNo}
        </Box>
        <Box
          height={200}
          width={200}
          color="black"
          backgroundColor="white"
          my={4}
          fontSize={30}
          gap={4}
          p={2}
          sx={{ border: "2px solid grey" }}
        >
          Confirmed orders
          <br />
          <br />
          {confirmedNo}
        </Box>
      </div>
      <table border="1">
        <caption>Cutomer Management</caption>

        <thead>
          <tr>
            <th>Customer name</th>
            <th>Customer city</th>
            <th>Customer phone</th>
            <th>Product</th>
            <th>Customer Id</th>
          </tr>
        </thead>
        <tbody>{customerTableData()}</tbody>
      </table>
    </>
  );
};

export default Dashboard;
